import ExpenseItem from "./components/ExpenseItem";
function App() {
  const expense = [
    { title: "A", amount: 123 },
    { title: "B", amount: 345 },
  ];
  return (
    <div>
      <ExpenseItem title={expense.title}></ExpenseItem>
      <h2>Let's get started!</h2>
      <h1>Hello World</h1>
    </div>
  );
}

export default App;
